DROP SEQUENCE Customer_Seq; 
CREATE SEQUENCE Customer_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 100
NOCYCLE;

drop table Customer cascade constraints;
create table Customer
(CustomerID int,
CustomerName varchar2(35),
CustomerEmail varchar2(50),
CustomerPhone varchar2(30),
CustomerAddress varchar2(80),
primary key (CustomerID)
);

DROP SEQUENCE Customer_Seq; 
CREATE SEQUENCE Customer_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 100
NOCYCLE;

create or replace trigger Customer_Trigger
before insert on Customer
for each row
when(new.CustomerID is null)
BEGIN
	select Customer_Seq.nextval
	into :new.CustomerID
	from dual;
end;
