drop table Instrument cascade constraints;
create table Instrument
(InstrumentID int,
InstrumentName varchar2(20), 
InstrumentLevel varchar2(20), 
InstrumentPrice Decimal(10, 2), 
primary key (InstrumentID)
);

Delete Instrument;

DROP SEQUENCE Instrument_Seq; 
CREATE SEQUENCE Instrument_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger Instrument_Trigger
before insert on Instrument
for each row
when(new.InstrumentID is null)
BEGIN
	select Instrument_Seq.nextval
	into :new.InstrumentID
	from dual;
end;
/

