Prompt ;
Prompt  Instrument TABLE DATA

SELECT *
from Instrument
order by InstrumentID;

drop table InstrumentRepair cascade constraints;
create table InstrumentRepair
(InstrumentRepairID int,
InstrumentType varchar2(20),
RepairType  varchar2(20),
RepairRequestDate date,
RepairFinishDate date,
RepairPrice decimal(10, 2),
primary key (InstrumentRepairID)
);

Delete InstrumentRepair;

DROP SEQUENCE InstrumentRepair_Seq;
CREATE SEQUENCE InstrumentRepair_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger InstrumentRepair_Trigger
before insert on InstrumentRepair
for each row
when(new.InstrumentRepairID is null)
BEGIN
	select InstrumentRepair_Seq.nextval
	into :new.InstrumentRepairID
	from dual;
end;
/

/*To show the Full header*/
COLUMN RepairRequestDate FORMAT A20;
COLUMN RepairFinishDate FORMAT A20;

