drop table MusicLesson cascade constraints;
create table MusicLesson
(MusicLessonID int, 
StudentName varchar2(40),
CompetencyLevel varchar2(20),
LessonType varchar2(20),
ClassSize int,
ClassStartDate date,
ClassEndDate date,
LessonPrice Decimal(10, 2),
primary key (MusicLessonID)
);


Delete MusicLesson;
DROP SEQUENCE MusicLesson_Seq;
CREATE SEQUENCE MusicLesson_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger MusicLesson_Trigger
before insert on MusicLesson
for each row
when(new.MusicLessonID is null)
BEGIN
	select MusicLesson_Seq.nextval
	into :new.MusicLessonID
	from dual;
end;
/

/*To show the Full header*/
COLUMN ClassStartDate FORMAT A15;
COLUMN ClassEndDate FORMAT A15;


