Delete PaymentType;

drop table PaymentType cascade constraints;
create table PaymentType
(
PaymentID int,
PaymentName varchar2(50),
CashPayment varchar2(3),
CreditCard varchar2(20),
Rental varchar(3),
PaymentPaid varchar2(3),
primary key (PaymentID),
foreign key (PaymentID) references Customer(CustomerID)
);
/*To show the Full header*/
DROP SEQUENCE PaymentType_Seq;
CREATE SEQUENCE PaymentType_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger PaymentType_Trigger
before insert on PaymentType
for each row
when(new.PaymentID is null)
BEGIN
	select PaymentType_Seq.nextval
	into :new.PaymentID
	from dual;
end;
/

