/*To show the Full header*/
COLUMN CashPayment FORMAT A4;
COLUMN Rental FORMAT A6;
COLUMN PaymentPaid FORMAT A11;

Prompt ;
Prompt Payment Type TABLE DATA;

SELECT *
from PaymentType
Order by PaymentID;

drop table DonationLog cascade constraints;
create table DonationLog
(DonatorID int,
DonatorName varchar2(60),
InstrumentType varchar2(20),
DonationDate DATE,
PRIMARY KEY (DonatorID)
);

Delete DonationLog;
DROP SEQUENCE DonationLog_Seq;
CREATE SEQUENCE DonationLog_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger DonationLog_Trigger
before insert on DonationLog
for each row
when(new.DonatorID is null)
BEGIN
	select DonationLog_Seq.nextval
	into :new.DonatorID
	from dual;
end;
/

