Prompt ;
Prompt DonationLog TABLE DATA;

SELECT *
from DonationLog;

drop table MusicReception cascade constraints;
create table MusicReception
(ReceptionID int,
MusicianName varchar2(30),
InstrumentName varchar2(20),
CustomerParticipant INT,
VoteCountTotal INT,
ReceptionDate date,
PRIMARY KEY (ReceptionID)
/*foreign key (ReceptionID) references Donationlog(DonatorID)*/
/*foreign key (CustomerParticipant) references Customer(CustomerName)*/
);

Delete MusicReception;
DROP SEQUENCE MusicReception_Seq;
CREATE SEQUENCE MusicReception_Seq
START WITH 1
INCREMENT BY 1
MINVALUE 1
MAXVALUE 10000
Cache 10000
NOCYCLE;

create or replace trigger MusicReception_Trigger
before insert on MusicReception
for each row
when(new.ReceptionID is null)
BEGIN
	select MusicReception_Seq.nextval
	into :new.ReceptionID
	from dual;
end;
/
